import React, { Component } from 'react';
import {connect} from 'react-redux';
import './dashboard.css';
import * as actions from '../../actions/auth';
import Sidebar from '../sidebar/sidebar';

class Dashboard extends Component {

	constructor(props){
		super(props) ;

		this.state = {
			email : '' , 
			password : '' ,
			fname : '' ,
			lname : '',
			dob : '' ,
			gender : '',
			error : ''
		}
	}

	onChangeUsername(e){
		this.setState({
			username : e.target.value
		})
	}
	onChangePassword(e){
		this.setState({
			password : e.target.value
		})
	}

    render() {
        return (
            	<div>
			        <Sidebar/>
					<div id="dash_title">
                <h1 id="h1_dashboard">Dashboard</h1>
            </div>
        <div class="mycontainer">
        <table>
            <tr>
                <td>
                        <div class="card">
                                <div class="card-img-top"></div>
                                <div class="card-body">
                                  <a href="#">SP19: CMPE-273 Sec 1</a>
								  <p class="p_dashboard">SP19: CMPE-273 Sec 1</p>
                                </div>
                        </div>
                </td>
                <td>
                        <div class="card">
                                <div class="card-img-top"></div>
                                <div class="card-body">
								<a href="#">SP19: CMPE-202 Sec 3</a>
								<p class="p_dashboard">SP19: CMPE-202 Sec 3</p>
                                </div>
                        </div>
                </td>
            </tr>


            <tr>
                    <td>
                            <div class="card">
                                    <div class="card-img-top"></div>
                                    <div class="card-body">
									<a href="#">SP19: CMPE-283 Sec 1</a>
									<p class="p_dashboard">SP19: CMPE-283 Sec 1</p>
                                    </div>
                            </div>
                    </td>
                    <td>
                            <div class="card">
                                    <div class="card-img-top"></div>
                                    <div class="card-body">
									<a href="#">SP19: CMPE-180C Sec 1</a>
									<p class="p_dashboard">SP19: CMPE-180C Sec 1</p>
                                    </div>
                            </div>
                    </td>
                </tr>
        </table>
    </div>

      			</div>
        );
    }
}


function mapStateToProps(state) {
    return {
    	user_id: state.auth.user_id

    };
}

function mapDispatchToProps(dispatch) {
    return {

    };
}

export default connect(mapStateToProps,mapDispatchToProps)(Dashboard);
